/* eslint-disable jsx-a11y/alt-text */
import { AppBar, Button, Link, Toolbar } from "@mui/material";
import LOGO from "../assets/logos/solxraf_navbar.png";
import { navbarLinks } from "../../database/NavbarData";

const Navbar = () => {
  const links = {
    color: "#fff",
    textDecoration: "none",
    textTransform: "capitalize",
    padding: "23px",
    fontWeight: "700",
    "&:hover": {
      backgroundColor: "#fff2",
    },
  };

  return (
    <AppBar sx={{ backgroundColor: "#304FA1", px: "50px" }}>
      <Toolbar sx={{ display: "flex" }}>
        <div style={{ flex: 1 }}>
          <img src={LOGO} style={{ width: "10vw" }} />
        </div>
        <div style={{ flex: 4, display: "flex", justifyContent: "center" }}>
          {navbarLinks.map((data, i) => (
            <Button
              style={{ padding: "0" }}
              onClick={() => {
                // setCreate(false);
              }}
            >
              <Link to={"#"} style={links}>
                Venues
              </Link>
            </Button>
          ))}
        </div>
        <div style={{ flex: 1, backgroundColor: "#0f0" }}>social</div>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
